import React from 'react';

class App extends React.Component {
  state = {
    isLoading: true,
    employees: [],
  }

  componentDidMount(){
    fetch('/employees.json')
      .then(response => response.json())
      .then(employees => {
        this.setState({
          employees: employees,
          isLoading: false
        })
      });
  }
  render (){
    const {isLoading, employees} = this.state;

    if (isLoading) {
      return <div>Loading...</div>;
    }
    return (
      <table className="table">
      <tr>
        <th>Name</th>
        <th>Role</th>
        <th>Phone #</th>
      </tr>
      {employees.map(employee => (        
        <tr key={employee.id}>
          <td>{employee.name}</td>
          <td>{employee.role}</td>
        </tr>
      ))}
      </table>
    )
}
}


export default App;
